import { memo } from 'react'
import './BookingPayment.scss'
import MomoLogo from '../../images/momo.png'

function BookingPayment({ languageList }) {
    return (
        <div className='section-tour-detail'>
            <div className='d-flex'>
                <div className='d-flex select-payment'>
                    <input type='radio' checked />
                    <label className='title-create-tour'>{languageList.txtMomo}</label>
                </div>
            </div>
        </div>
    )
}

export default memo(BookingPayment)
